/**
 * @fileoverview Routines to state whether a given version needs updating,
 * and other version-based attributes.
 */
'use strict';

/**
 * Return whether gnubby applet needs an update.
 * @param {string=} opt_current Current version.
 * @return {boolean} whether update is needed.
 */
function gnubby_needsUpdate(opt_current) {
  return !!opt_current && opt_current < gnubby_currentVersionString;
}

/**
 * Return whether gnubby is likely a pilot one.
 * @param {string=} opt_current Current version.
 * @return {boolean} whether gnubby is likely pilot one.
 */
function gnubby_isPilotVersion(opt_current) {
  return !!opt_current && opt_current == gnubby_pilotVersionString;
}

/**
 * Return whether ssh applet needs an update.
 * @param {string=} opt_current Current version.
 * @return {boolean} whether update is needed.
 */
function ssh_needsUpdate(opt_current) {
  var result = !!opt_current && opt_current < ssh_currentVersionString;
  return result;
}

/**
 * Return whether ssh applet supports PIN change.
 * @param {string=} opt_current Current version.
 * @return {boolean} whether PIN change is supported.
 */
function ssh_supportsPINChange(opt_current) {
  var old = !opt_current || opt_current < '0.1.0';
  return !old;
}

/**
 * Return the firmware version contained in the sysinfo response, as a
 * byte array.
 * @param {Uint8Array} sysInfo The sysinfo command's output.
 * @return {Uint8Array} The firmware version, as a byte array.
 */
function sysInfoToFirmwareVersionBytes(sysInfo) {
  // Sample sysinfo response data:
  //'476E75626279310000070400040108A0000005271002010000000000000000'
  // Firmware version is at byte offsets 8 - 10, i.e. 0.7.4 in the above
  // example.
  return sysInfo.subarray(8, 8 + 3);
}

/**
 * Return the firmware version contained in the sysinfo response, as a
 * version string.
 * @param {Uint8Array} sysInfo The sysinfo command's output.
 * @return {string} The firmware version, as a string.
 */
function sysInfoToFirmwareVersionString(sysInfo) {
  var fwVersion = sysInfoToFirmwareVersionBytes(sysInfo);
  return '' + fwVersion[0] + '.' + fwVersion[1] + '.' + fwVersion[2]
}

/**
 * Return the applet version contained in the sysinfo response, as a
 * byte array.
 * @param {Uint8Array} sysInfo The sysinfo command's output.
 * @return {Uint8Array} The applet version, as a byte array.
 */
function sysInfoToAppletVersionBytes(sysInfo) {
  // Sample sysinfo response data:
  //'476E75626279310000070400040108A0000005271002010000000000000000'
  // Applet version is at byte offsets 11 - 13, i.e. 0.4.1 in the above
  // example.
  return sysInfo.subarray(11, 11 + 3);
}

/**
 * Return the U2F applet version contained in the sysinfo response, as a
 * version string.
 * @param {Uint8Array} sysInfo The sysinfo command's output.
 * @return {string} The U2F applet version, as a string.
 */
function sysInfoToU2fAppletVersionString(sysInfo) {
  var appletVersion = sysInfoToAppletVersionBytes(sysInfo);
  return '' + appletVersion[0] + '.' + appletVersion[1] + '.'
      + appletVersion[2]
}

/**
 * Return whether firmware needs an update.
 * @param {string=} opt_current Current version.
 * @return {boolean} whether update is needed.
 */
function firmware_needsUpdate(opt_current) {
  if (!opt_current) return true;
  var targetFirmwareVersion = firmware_getMostRecentStableVersion(opt_current);
  return opt_current < targetFirmwareVersion;
}

/**
 * Return either 'USB' or 'HID' reflecting fw type.
 * @param {string=} opt_current Current version.
 * @return {string} type.
 */
function firmware_type(opt_current) {
  if (opt_current < '0.6.0') {
    return 'USB';
  } else {
    return 'HID';
  }
}

/**
 * Returns the most current stable firmware of the same type as the current
 * firmware version.
 * @param {string=} opt_current Current version string.
 * @return {string} Most recent firmware version.
 */
function firmware_getMostRecentStableVersion(opt_current) {
  if (firmware_type(opt_current) == 'USB') {
    return firmware_currentVersionString;
  }
  return firmware_currentHIDVersionString;
}

/**
 * Return HTML OPTION string for firmware version.
 * @param {string=} opt_version Current version string.
 * @param {boolean=} opt_select Select this entry.
 * @return {string} annotated HTML OPTION.
 */
function firmware_asOptionString(opt_version, opt_select) {
  var s = '<option value="' + opt_version;
  if (opt_select) s += ' selected disabled';
  s += '">';
  s += firmware_type(opt_version) + ' firmware ' + opt_version;
  if (opt_version == firmware_betaVersionString ||
      opt_version == firmware_betaHIDVersionString) {
    s += ' (beta)';
  }
  s += '</option>';
  return s;
}

/**
 * Return string of HTML OPTION choices for available firmwares.
 * @param {string=} opt_current Current version.
 * @return {string} HTML.
 */
function firmware_options(opt_current) {
  var s = firmware_asOptionString(opt_current, true);

  if (opt_current != firmware_stableVersionString) {
    s += firmware_asOptionString(firmware_stableVersionString);
  }
  if (opt_current != firmware_stableHIDVersionString) {
    s += firmware_asOptionString(firmware_stableHIDVersionString);
  }
  if (firmware_betaVersionString && opt_current != firmware_betaVersionString) {
    s += firmware_asOptionString(firmware_betaVersionString);
  }
  if (firmware_betaHIDVersionString &&
      opt_current != firmware_betaHIDVersionString) {
    s += firmware_asOptionString(firmware_betaHIDVersionString);
  }
  return s;
}

/**
 * Return desired firmware image.
 * @param {string} version of firmware.
 * @return {?string} hex-encoded firmware code.
 */
function firmware_getImage(version) {
  if (version == firmware_stableVersionString)
      return firmware_stableVersion;
  if (version == firmware_stableHIDVersionString)
      return firmware_stableHIDVersion;
  if (version == firmware_betaVersionString)
      return firmware_betaVersion;
  if (version == firmware_betaHIDVersionString)
      return firmware_betaHIDVersion;
  return null;
}

var gnubby_pilotVersionString = '0.4.1';

var gnubby_currentVersionString = '1.0.2';
var ssh_currentVersionString = '0.1.3';

var firmware_stableVersionString = '0.3.4';
var firmware_stableVersion =
'';

var firmware_betaVersionString = null;
var firmware_betaVersion = null;

var firmware_stableHIDVersionString = '0.9.7';
var firmware_stableHIDVersion =
    '';

var firmware_betaHIDVersionString = null;
var firmware_betaHIDVersion = null;

var firmware_currentVersionString = firmware_stableVersionString;
var firmware_currentVersion = firmware_stableVersion;
var firmware_currentHIDVersionString = firmware_stableHIDVersionString;
var firmware_currentHIDVersion = firmware_stableHIDVersion;

function bleedingEdgeFirmware() {
  if (firmware_betaVersionString && firmware_betaVersion) {
    firmware_currentVersionString = firmware_betaVersionString;
    firmware_currentVersion = firmware_betaVersion;
  }
  if (firmware_betaHIDVersionString && firmware_betaHIDVersion) {
    firmware_currentHIDVersionString = firmware_betaHIDVersionString;
    firmware_currentHIDVersion = firmware_betaHIDVersion;
  }
}

function stableFirmware() {
  firmware_currentVersionString = firmware_stableVersionString;
  firmware_currentVersion = firmware_stableVersion;
  firmware_currentHIDVersionString = firmware_stableHIDVersionString;
  firmware_currentHIDVersion = firmware_stableHIDVersion;
}
